import React from "react";
import Slider from "react-slick";
import "./MediaSlider.css";

const MediaSlider = () => {
  // Cloudinary configuration - ganti dengan cloud name Anda
  const CLOUDINARY_BASE_URL = "https://res.cloudinary.com/YOUR_CLOUD_NAME/";

  // Media data - ganti dengan public_id dari media yang sudah diupload ke Cloudinary
  const mediaItems = [
    {
      type: "image",
      publicId: "kampung-pujokusuman/hero-image",
      title: "Suasana Kampung Pujokusuman",
      description:
        "Pemandangan indah kampung dengan arsitektur tradisional Jawa",
    },
    {
      type: "image",
      publicId: "kampung-pujokusuman/tari-tradisional",
      title: "Tari Tradisional",
      description: "Pertunjukan tari klasik Jawa oleh para penari muda",
    },
    {
      type: "video",
      publicId: "kampung-pujokusuman/gamelan-performance",
      title: "Pertunjukan Gamelan",
      description: "Musik tradisional gamelan yang memukau",
    },
    {
      type: "image",
      publicId: "kampung-pujokusuman/batik-workshop",
      title: "Workshop Batik",
      description: "Kegiatan membatik bersama warga kampung",
    },
    {
      type: "image",
      publicId: "kampung-pujokusuman/kerajinan-tangan",
      title: "Kerajinan Tangan",
      description: "Hasil karya kerajinan anyaman bambu",
    },
    {
      type: "video",
      publicId: "kampung-pujokusuman/wayang-kulit",
      title: "Wayang Kulit",
      description: "Pertunjukan wayang kulit malam hari",
    },
  ];

  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 3,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 4000,
    pauseOnHover: true,
    responsive: [
      {
        breakpoint: 1024,
        settings: {
          slidesToShow: 2,
          slidesToScroll: 1,
        },
      },
      {
        breakpoint: 768,
        settings: {
          slidesToShow: 1,
          slidesToScroll: 1,
        },
      },
    ],
  };

  const getMediaUrl = (publicId, type) => {
    if (type === "video") {
      return `${CLOUDINARY_BASE_URL}video/upload/q_auto,f_auto/${publicId}.mp4`;
    } else {
      return `${CLOUDINARY_BASE_URL}image/upload/q_auto,f_auto,w_400,h_300,c_fill/${publicId}.jpg`;
    }
  };

  const getPlaceholderImage = (title) => {
    // Placeholder dengan gradient dan teks untuk development
    const canvas = document.createElement("canvas");
    canvas.width = 400;
    canvas.height = 300;
    const ctx = canvas.getContext("2d");

    // Gradient background
    const gradient = ctx.createLinearGradient(0, 0, 400, 300);
    gradient.addColorStop(0, "#8B4513");
    gradient.addColorStop(1, "#DAA520");
    ctx.fillStyle = gradient;
    ctx.fillRect(0, 0, 400, 300);

    // Text
    ctx.fillStyle = "white";
    ctx.font = "20px Arial";
    ctx.textAlign = "center";
    ctx.fillText(title, 200, 150);

    return canvas.toDataURL();
  };

  return (
    <div className="media-slider">
      <div className="container">
        <div className="section-header fade-in">
          <h2>Galeri Media</h2>
          <p>Dokumentasi foto dan video kegiatan budaya Kampung Pujokusuman</p>
        </div>

        <Slider {...settings} className="media-carousel">
          {mediaItems.map((item, index) => (
            <div key={index} className="media-slide">
              <div className="media-card">
                {item.type === "video" ? (
                  <div className="video-container">
                    <video
                      poster={getPlaceholderImage(item.title)}
                      controls
                      preload="metadata"
                      className="media-video"
                    >
                      <source
                        src={getMediaUrl(item.publicId, "video")}
                        type="video/mp4"
                      />
                      {/* Fallback untuk browser yang tidak support video */}
                      <img
                        src={getPlaceholderImage(item.title)}
                        alt={item.title}
                        className="media-image"
                      />
                    </video>
                    <div className="video-overlay">
                      <div className="play-button">‚ñ∂</div>
                    </div>
                  </div>
                ) : (
                  <div className="image-container">
                    <img
                      src={getMediaUrl(item.publicId, "image")}
                      alt={item.title}
                      className="media-image"
                      onError={(e) => {
                        // Fallback jika gambar tidak ditemukan
                        e.target.src = getPlaceholderImage(item.title);
                      }}
                    />
                    <div className="image-overlay">
                      <div className="zoom-icon">üîç</div>
                    </div>
                  </div>
                )}

                <div className="media-content">
                  <h3>{item.title}</h3>
                  <p>{item.description}</p>
                  <div className="media-type-badge">
                    {item.type === "video" ? "üé• Video" : "üì∑ Foto"}
                  </div>
                </div>
              </div>
            </div>
          ))}
        </Slider>

        <div className="cloudinary-credit">
          <p>
            Media disimpan dengan{" "}
            <a
              href="https://cloudinary.com"
              target="_blank"
              rel="noopener noreferrer"
            >
              Cloudinary
            </a>
          </p>
        </div>
      </div>
    </div>
  );
};

export default MediaSlider;
